class Solution(object):
    def minSizeSubarray(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: int
        """
        from collections import deque
        prefix_sum = [0]
        for num in nums:
            prefix_sum.append(prefix_sum[-1] + num)
        if prefix_sum[-1] == 0 or prefix_sum[-1] < target:
            return -1

        result = float('inf')
        q = deque()
        for i, val in enumerate(prefix_sum):
            while q and val - prefix_sum[q[0]] >= target:
                result = min(result, i - q.popleft())
            q.append(i)

        return result if result != float('inf') else -1
